// TopNavBar.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/navbar.css';  

const TopNavBar = ({  handleLogout }) => {
    return (
        <nav className="top-navbar">
            <div className="menu-dropdown">
                <p className="menu-icon">â˜°<b>Menu</b></p>
                <div className="side-menu">
                    <ul>
  
                    <li><Link to="/home">Home Page</Link>Home Page</li>
                    <li><Link to="/TrackHealth">Track Your Health</Link>Track Your Health</li>
                    <li><Link to="/HeartHealthData">Previous risk levels</Link></li>
                        <li><Link to="/Profile">Profile Page</Link></li>
                        <li ><Link to="/bmi">Calculate BMI</Link></li>
                        <li ><Link to="/">Logout</Link></li>
                    </ul>
                </div>
            </div>

            <div className="nav-title">
                <span className="stethoscope-icon">ðŸ©º</span>
                Healthcare Analytics
            </div>
            <div style={{ width: 'fit-content' }}></div>
        </nav>
    );
};

export default TopNavBar;
